# This is the solution O(n)
def palindromeIndex(s):
    i, j = 0, len(s) - 1

    while i < j  and s[i] == s[j]:
        i += 1
        j -= 1

    if i >= j:
        return -1

    ii, jj  = i + 1, j
    while ii < jj and s[ii] == s[jj]:
        ii += 1
        jj -= 1
    if ii >= jj:
        return i

    ii, jj = i , j -1
    while ii < jj and s[ii] == s[jj]:
        ii += 1
        jj -= 1
    if ii >= jj:
        return j


